import { useEffect, useState } from "react";
import { Route, useHistory, Switch } from "react-router";

import axios from "axios";
import { useTheme } from "@material-ui/core/styles";

// components
import Sidebar from "../components/Sidebar/Sidebar";
import MainContent from "../components/Content/MainContent";
// styles
import useStyles from "./DashbaordStyles";
import Navbar from "../components/Navbar/Navbar";
import Client from "../components/Content/Client/Client";
import Branch from "../components/Content/Branch/Branch";
import ContactPerson from "../components/Content/ContactPerson/ContactPerson";
import Contract from "../components/Content/Contract/Contract";
import Count from "../components/Content/Count";
import Profile from "../components/Content/Profile/Profile";
import Test from "./Test";
import clsx from "clsx";
import Drawer from "@material-ui/core/Drawer";
import CssBaseline from "@material-ui/core/CssBaseline";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import List from "@material-ui/core/List";
import Typography from "@material-ui/core/Typography";
import Divider from "@material-ui/core/Divider";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import ChevronRightIcon from "@material-ui/icons/ChevronRight";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";

const Dashboard = () => {
  const classes = useStyles();
  const history = useHistory();
  const theme = useTheme();
  const [open, setOpen] = useState(false);

  const handleDrawerOpen = () => {
    setOpen(true);
  };

  const handleDrawerClose = () => {
    setOpen(false);
  };

  useEffect(() => {
    axios
      .get("/auth/refreshtoken")
      .then((response) => {})
      .catch((err) => history.push("/"));
  }, [history]);

  return (
    <div className={classes.root}>
      <CssBaseline />

      <AppBar
        position="fixed"
        className={clsx(classes.appBar, {
          [classes.appBarShift]: open,
        })}
      >
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            edge="start"
            className={clsx(classes.menuButton, open && classes.hide)}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" noWrap>
            Persistent drawer
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        className={classes.drawer}
        variant="persistent"
        anchor="left"
        open={open}
        classes={{
          paper: classes.drawerPaper,
        }}
      >
        <div className={classes.drawerHeader}>
          <IconButton onClick={handleDrawerClose}>
            {theme.direction === "ltr" ? (
              <ChevronLeftIcon />
            ) : (
              <ChevronRightIcon />
            )}
          </IconButton>
        </div>
        <Divider />
        <Sidebar />

        <List>
          {["Inbox", "Starred", "Send email", "Drafts"].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>

        <Divider />
      </Drawer>

      <main
        className={clsx(classes.content, {
          [classes.contentShift]: open,
        })}
      >
        <div className={classes.drawerHeader} />

        <Switch>
          <Route path="/client">
            <Client />
          </Route>
          <Route path="/branch">
            <Branch />
          </Route>
          <Route path="/contactPerson">
            <ContactPerson />
          </Route>
          <Route path="/contract">
            <Contract />
          </Route>
          <Route path="/profile">
            <Profile />
          </Route>
          <Route path="/test">
            <Test />
          </Route>
          <Route path="/">
            <Count />
          </Route>
        </Switch>
      </main>
    </div>
  );
};

export default Dashboard;
